Odontobuthus
may be separated from other genera of Buthidae by the following combination of characters ( Stahnke, 1972 ; Farzanpay, 1987 ; Lourenço & Pézier, 2002 ; Lowe, 2010 ;
Mirshamsi et al. , 2013
;
Navidpour et al. , 2013
): cheliceral movable finger with two ventral denticles; carapace dorsal surface entirely horizontal in lateral aspect; carapacial carinae distinct, with lyriform configuration; pedipalp trichobothriotaxy type A-β; trichobothrium eb situated at distal end of chela manus or on fixed finger; patella trichobothrium d 3 situated prolateral to dorsomedian carina; proximal dentate margins of chela fixed and movable fingers not sexually dimorphic in adult male, i.e. without notch and lobe, respectively, in lateral aspect; median denticle row of chela fixed and movable fingers each comprising 10–14 oblique, non-imbricate subrows of denticles, each flanked by single prolateral and retrolateral accessory denticles; tibial spurs present on legs III and IV; pectines with fulcra; ventrosubmedian carinae of metasomal segments II and III comprising prominent tooth-like processes (spiniform granules); anteroventral carina of metasomal segment IV comprising prominent granules; ventrolateral carinae of metasomal segment V with prominent lobate processes; anal arch with prominent lobes laterally and reduced lobes posteroventrally; telson globose, without subaculear tubercle; hemispermatophore capsule with hook-like basal lobe and sperm hemiduct of three lobes.
